import React from 'react';

function TimelineAnalyzer({ userGoal = '', goalOptions = [] }) {
  return (
    <div className="p-8">
      <h2 className="text-3xl font-bold mb-4 text-center">Timeline Analyzer</h2>
      <div className="bg-white shadow-lg rounded-lg p-4">
        <label className="block mb-2">Your Goal:</label>
        <select className="w-full p-2 border border-gray-300 rounded-lg" defaultValue={userGoal}>
          {goalOptions.map((goal, index) => (
            <option key={index} value={goal}>
              {goal}
            </option>
          ))}
        </select>
      </div>
    </div>
  );
}

export default TimelineAnalyzer;
